import Footer from './components/inc/Footer';
import About from './components/pages/About';
import Contact from './components/pages/Contact';
import { BrowserRouter as Router } from 'react-router-dom';

function App() {
  return (
    <Router>

    <div>
      <Navbar></Navbar>
      <Home></Home>
      <Footer></Footer>
    </div>
    </Router>
  );
}

export default App;
